import React from 'react'
import { useEffect, useState} from 'react';


function Profile({profileID}) {
    const [profiles, setProfiles] = useState([])
    const API = `http://localhost:3000/profiles/${profileID}`
    useEffect(() => {
      async function fetchProducts(){
        const result = await fetch(API);
        const items = await result.json();
        setProfiles(items)
      }
      fetchProducts()
    }, [])
    console.log(profiles)

    return (
        <div className="profilePage">
            <h1>Profile</h1>
            <hr/>
            <img className="profileImage" src={profiles.profile_picture} alt={profiles.name}/>
            <br/><br/>
            <div>
            <h3>User{profiles.user_id}</h3>
            <hr/>
            <div className="col">
                <h4 className="profileDetails">Location:</h4>
                <h4 className="profileDetails">About: </h4>
                <h4 className="profileDetails">Gender: </h4>
            </div>
            <div className="col">
                <h4> {profiles.location}</h4>
                <h4> {profiles.bio}</h4>
                <h4> {profiles.gender}</h4>
            </div>
            </div>
            <br/>
        </div>
    )
}

export default Profile
